Descrição:
Eylia - 40mg/mL, caixa com 1 seringa preenchida com 0,165mL de solução de uso intravítreo.

Eylia® (aflibercepte) é indicado para o tratamento de:
Degeneração macular relacionada à idade, neovascular (DMRI) (úmida);
Deficiência visual devido ao edema macular secundário à oclusão da veia da retina (oclusão da veia central da retina (OVCR) ou oclusão de ramo da veia da retina (ORVR));
Deficiência visual devido ao edema macular diabético (EMD);
Deficiência visual devido à neovascularização coroidal miópica (NVC miópica).

Stivarga® (regorafenibe) é indicado para o tratamento de pacientes adultos com:
Tumores estromais gastrintestinais (GIST) metastáticos ou não ressecáveis, que tenham progredido ou experimentaram intolerância ao tratamento prévio com imatinibe e sunitinibe;
Carcinoma hepatocelular (CHC) que tenham sido previamente tratados com sorafenibe, um medicamento indicado para tratamento de câncer de fígado que não possa ser removido com cirurgia;
Câncer colorretal (CCR) metastático que tenham sido previamente tratados com, ou não sejam considerados candidatos para, as terapias disponíveis. Estas incluem quimioterapia à base de fluoropirimidinas, terapia anti-VEGF e terapia anti-EGFR.
Stivarga® (regorafenibe) deve ser prescrito e controlado por um oncologista ou profissional de saúde capacitado para tratar pacientes com câncer gastrintestinal ou câncer de fígado.

VECTIBIX é indicado para o tratamento de pacientes adultos com câncer colorretal metastático RAS tipo selvagem (CCRm):
* em primeira linha em combinação com FOLFOX ou FOLFIRI  vide “Eficácia clínica em combinação com quimioterapia”);
*em segunda linha em combinação com FOLFIRI para pacientes que receberam quimioterapia de primeira linha à base de fluoropirimidina (excluindo irinotecano);
*como monoterapia após falha com regimes de quimioterapia contendo fluoropirimidina, oxaliplatina e irinotecano.

Erleada® é indicado para o tratamento de pacientes com:
Câncer de próstata que se espalhou para outras partes do corpo e que ainda respondem a medicamentos que diminuem a testosterona;

Câncer de próstata que não se espalhou para outras partes do corpo, após falha à terapia de privação de androgênios (um hormônio sexual).
